import axios from 'axios'

function App() {
  const[punkListData, setPunkListData] = useState([])
  useEffect(() => {
    const getMyNfts = async () => {
      const openseaData = await axios.get('https://testnets-api.opensea.io/assets?asset_contract_address=0xC36d211Da64a4cDD727F722196545Ec8799BeD9e&order_direction=ascending')
      console.log(openseaData.data.assets)
    }
      return getMyNfts()
    }, [])




  return (
    <div className='app'>
    <Header />
    <CollectionCard 
    id={0} 
